import React, { useState } from 'react';
import * as FaIcons from "react-icons/fa";
import * as AiIcons from "react-icons/ai";
import { Link } from 'react-router-dom';
import { SidebarData } from './SidebarData'
import './Navbar.css'
import { IconContext } from 'react-icons'

function Navbar() {
    const [sidebar, setSidebar] = useState(false)
    const showSidebar = () => setSidebar(!sidebar)
    const [menu, setMenu] = useState(false)
    const showMenu = () => setMenu(!menu)

    return (
        <>
            <IconContext.Provider value={{ color: 'navy' }}>
                <div className="navbar">
                    <Link to="#" className="menu-bars">
                        <FaIcons.FaBars onClick={showSidebar} />
                    </Link>
                </div>
                <nav className={sidebar ? 'nav-menu active' : 'nav-menu'}>
                    <ul className='nav-menu-items' onClick={showSidebar}>
                        <li className="navbar-toggle">
                            <Link to="#" className='menu-bars'>
                                <AiIcons.AiOutlineClose />
                            </Link>
                        </li>
                        {SidebarData.map(({ cName, path, icon, title, SidebarData: subItem, index }) => {
                            return (
                                <li key={index} className={cName}>
                                    <Link to={path}>
                                        {icon}
                                        <span>{title}</span>
                                    </Link>
                                </li>
                            )
                        })}
                        {Array.isArray({ SidebarData: subItems }) ? (
                            <li>
                                {subItem.map((subItem) => (
                                    <li key={subItem.name} button>
                                        <li className="sidebar-item-text">
                                            {subItem.label}
                                        </li>
                                    </li>
                                ))}
                            </li>
                        ) : null}
                        {/* <ul className="nav-text2" onClick={showMenu}>
                            <AiIcons.AiOutlineClose /><span>Room</span>
                        </ul>
                        {showMenu ? (<div></div>) : (null)} */}
                    </ul>
                </nav>
            </IconContext.Provider>
        </>
    );
}

export default Navbar;
